import React from 'react' ;
import Code from "./data1";
import "./App.css" ;


function App() {
    const style1 = {
        background : "red",
        color: "#fff" ,
        display : "flex" ,
        justifyContent : "space-between"
    }
  return (
        <div  style={ style1 }  >
            <Code  name ="islam"    age ="26"    city = "Mansoura"   /> 
            <Code  name ="asmaa"    age ="24"    city = "cairo"   /> 
            <Code  name ="shaimaa"    age ="42"    city = "cairo"   /> 
            <Code  name ="sayed"    age ="44"    city = "Alex"   /> 
      </div>  
  );
}

export default App;
